import '../node_modules/bootstrap/dist/css/bootstrap.min.css'

function App() {
  return (
    <div >
     <h1 className="text-center">Hello world</h1>
     <button type="button" class="btn btn-outline--success">Success</button>
    </div>
  );
}

export default App;
